const slider=$(".slider");slider.on("wheel",(function(i){i.preventDefault(),i.originalEvent.deltaY<0?$(this).slick("slickNext"):$(this).slick("slickPrev")})),$((function(){$(".slider").slick({infinite:!0,slidesToShow:1,slidesToScroll:1,arrows:!0,centerMode:!0,centerPadding:"1px",ariableWidth:!0})}));